import { Draggable } from "react-beautiful-dnd";

export const DraggableBodyRow = ({ index, className, style, ...restProps }) => (
    <Draggable draggableId={data[index].id.toString()} index={index}>
      {(provided) => (
        <tr
          ref={provided.innerRef}
          {...provided.draggableProps}
          {...provided.dragHandleProps}
          className={className}
          style={{
            ...style,
            ...provided.draggableProps.style,
          }}
        >
          {restProps.children}
        </tr>
      )}
    </Draggable>
  );
